column8:
バンブーとは「松・竹・梅」で象徴される中性の「竹」を意味します。<br>
<br>
<b>【セット内容】</b><br>
●Bamboo本体（Ｗ9cm×Ｄ16cm×Ｈ11cm、重さ　約1.1kg<br><BR>

●付属品<BR>
ホース（1M)×1<BR>
ステンレス棒(20cm)×1<BR><BR>

<br>
<br>
<b>使い方はとっても簡単！</b><br>
食べ物や飲み物などに、ホースまたはステンレス棒の先を差し込んで、スイッチオン。<br>
ケミカルなものを、ナチュラルに変換してくれます。<br>
<br>
●研いだ玄米を一晩バンブーにつけて、玄米を元気にしてから炊飯してみてください。<br>
美味しくなるのが実感できます。特に古米など古いものほど違いを感じることができます。<br>
<br>
●空気活性器として使用する場合は是非寝室がおすすめです！<br>
夜の睡眠中が一番体の抵抗力がなくなり、悪玉菌が活性するので、病気が進行します。<br>
バンブーは電気代が殆どかからないので、スイッチをONにしたまま普段は寝室で御利用下さい。<br>
<br>
<br>
<b>【販売元】</b><br>
株式会社テネモスネット<br><br><style type="text/css">


